(1322, 154, 'texto', '<h3>De jovens para jovens</h3>\r\n<p>Os bate-papos realizados pelo [hi]School são executados por jovens universitários que passam por uma preparação multidisciplinar antes de poderem semear os valores humanos para os jovens do ensino médio. Pensando nisso, nós criamos o conceito "Aprenda a teoria e pratique bem". Cartazes e Flyers foram espalhados por algumas universidades do DF.</p>\r\n'),
