(1367, 158, '_ilustrativa', 'field_22'),
(1368, 158, 'texto', '<h3>No fim, é tudo semente do mesmo saco</h3>\r\n<p>Apesar de terem identidades distintas, os bate-papos precisavam ter algo que ligasse um ao outro, fazendo referência ao fato de que eles se complementam. Na execução, escolhemos o simbolo mais forte de cada bate-papo e deixamos que a fonte da logo e uma silhueta semelhante entre as logos realizasse tal função. Assim, de longe, uma logo pode fazer referência às outras.</p>\r\n'),
