(1674, 189, 'texto', '<h3>Sentir o que você lê</h3>\r\n<p>Nos preocupavamos em fazer com que as pessoas não só lessem as mensagens que tínhamos pra transmitir. Então, durante a criação das peças nos empenhamos bastante pra construir uma atmosfera que envolvesse a ideia do texto e que fizesse as pessoas sentirem a mensagem que queríamos passar, de forma que elas pudessem interiorizar e realmente levar tais conceitos pra sua vida, pro seu dia-a-dia.</p>\r\n'),
