(2080, 219, 'resumo', 'Há um momento que só ter sua banda no Facebook não é mais o suficiente. E a Dog Savanna percebeu que ter um site com todo seu conteúdo organizado interativamente e com fácil acesso melhoraria muito sua relação tanto com quem curte a banda, quanto com quem a contrata.'),
