(2100, 219, 'texto', '<h3>Centralizar para conquistar</h3>\r\n<p>Ter um perfil em várias redes sociais é indispensável para o sucesso de uma banda, mas chega um momento em que toda essa "energia" vai se dispersando por falta de vazão, e é aí que o site entra. Com todo conteúdo da banda organizado interativamente e um contato mais estreito com fãs e empresários a banda percebeu logo todos os benefícios de se ter o site como um ponto de convergência para todo o tráfego gerado pelas redes sociais.</p>\r\n'),
